require_relative 'min_max_stack_queue'
def windowed_max_range(arr, window_size)
  current_max_range = nil

  (0..arr.length - window_size).each do |i|
    window = arr[i, window_size]
    max_num = window.max
    min_num = window.min
    range = max_num - min_num
    current_max_range = range if current_max_range.nil? || range > current_max_range
  end

  current_max_range
end

def better_windowed_max_range(arr, window_size)
  current_max_range = nil
  window = MinMaxStackQueue.new
  i = 0

  while i < arr.length
    until window.size == window_size
      window.enqueue(arr[i])
      i += 1
    end

    range = window.max - window.min
    current_max_range = range if current_max_range.nil? || range > current_max_range
    window.dequeue
  end
  
  current_max_range
end

